  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import SideBar from './components/layout/Content/SideBar/SideBar';

const ContentWrapper = styled.div`
  display: flex;
`;

function App() {
  return (
    <Router>
      <Header></Header>
      <ContentWrapper>
        <SideBar />

      </ContentWrapper>
    </Router>
  );
}

export default App;
